What is the result of the following code?
int x = 5;
int y = 2;
System.out.println(x / y);,2,2.5,3,2.0

What is the output?
double d = 10.5;
int i = (int) d;
System.out.println(i);,10,10.5,11,Compilation error

What is the output?
boolean a = true;
boolean b = false;
System.out.println(a && b || a);,true,false,Compilation error,Runtime error

What is the result of type promotion in this code?
byte b = 10;
short s = 20;
System.out.println(b + s);,30 (int type),30 (byte type),30 (short type),Compilation error

What is the output?
int x = 5;
System.out.println(++x);,6,5,7,Compilation error

What happens with this code?
String s = "Hello";
s.concat(" World");
System.out.println(s);,Hello,Hello World,Compilation error,NullPointerException

What is the output?
StringBuilder sb = new StringBuilder("Java");
sb.append(" 17");
System.out.println(sb);,Java 17,Java,17,Compilation error

What is the result?
double d1 = 10.0 / 3.0;
System.out.println(d1);,3.333... (repeating),3,3.0,Compilation error

What is the output?
String s1 = "Java";
String s2 = "Java";
System.out.println(s1 == s2);,true,false,Compilation error,NullPointerException

What is the result?
int a = 5;
int b = 10;
System.out.println(a++ + ++b);,16,15,17,Compilation error

What is the output?
LocalDate date = LocalDate.of(2024, 1, 15);
System.out.println(date.getDayOfWeek());,MONDAY,15,1,January

What is the result?
LocalDateTime dt = LocalDateTime.of(2024, 1, 1, 10, 30);
System.out.println(dt.getHour());,10,30,1,2024

What happens with this code?
LocalDate date = LocalDate.now();
date.plusDays(5);
System.out.println(date);,Prints today's date,Prints date 5 days from now,Compilation error,NullPointerException

What is the output?
Duration d = Duration.ofHours(25);
System.out.println(d.toDays());,1,25,0,Compilation error

What is the result?
String s = "Java SE 17";
System.out.println(s.substring(5, 7));,SE,Java,17,Java SE

What is the output?
StringBuilder sb = new StringBuilder("Hello");
sb.insert(5, " World");
System.out.println(sb);,Hello World,HelloWorld, World Hello,Compilation error

Which wrapper class method auto-unboxes correctly?
Integer i = 100;
int x = ?,i,i.intValue(),Integer.parseInt(i),Both A and B

What is the output?
String s = "Hello";
System.out.println(s.replace('l', 'L'));,HeLLo,Hello,HELLO,Compilation error

What is the result?
byte b = 127;
b++;
System.out.println(b);,"Compilation error (requires cast)",-128,128,127

What is the output?
String s = "   Java   ";
System.out.println(s.trim());,Java,   Java   ,Java   ,   Java

What is the result?
LocalDate d1 = LocalDate.of(2024, 1, 1);
LocalDate d2 = d1.withMonth(12);
System.out.println(d2.getMonth());,DECEMBER,JANUARY,12,1

What is the output?
int x = 10;
double y = 3.5;
System.out.println(x + y);,13.5,13,14,Compilation error

What is the result?
Boolean b = null;
boolean result = b;
System.out.println(result);,NullPointerException,false,true,Compilation error

What is the output?
String s1 = new String("Java");
String s2 = new String("Java");
